import React from "react";

import { makeStyles } from "@material-ui/core/styles";
import Card from "@material-ui/core/Card";
import CardActions from "@material-ui/core/CardActions";
import TextField from "@material-ui/core/TextField";
import Select from "@material-ui/core/Select";
import MenuItem from "@material-ui/core/MenuItem";
import InputLabel from "@material-ui/core/InputLabel";
import FormControl from "@material-ui/core/FormControl";
import CurrencyTextField from "@unicef/material-ui-currency-textfield";
import Button from "@material-ui/core/Button";

import Sidebar from "../sidebar/Sidebar";
import TopBar from "../topbar/TopBar";
import BottomBar from "../bottombar/BottomBar";

const useStyles = makeStyles({
  root: {
    minWidth: 275,
    margin: "10px auto",
    height: "fit-content",
    display: "flex",
    flexDirection: "column",
    justifyContent: "center",
    width: "90%",
    maxWidth: "400px",
  },
  text: {
    borderBottom: "1px solid grey",
    textAlign: "center",
    margin: "10px auto",
    width: "90%",
  },
  input: {
    margin: "10px auto",
    width: "90%",
  },
  buttonWrap: {
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
  },
});
export const IncomeExpenseAdd = () => {
  const classes = useStyles();
  const [type, setType] = React.useState("");
  const [value, setValue] = React.useState(0.0);
  const error = value < 0.01;
  const to = () => {
    props.history.push("/incomeexpensecard");
  };
  function resetValue() {
    setValue(0);
  }
  const handleChange = (event) => {
    setType(event.target.value);
  };
  return (
    <div>
      <div>
        <h1>
          Fill out this form to add any income you make for the month, and
          subract any money you spend in the month.
        </h1>
        <TextField
          id="filled-basic"
          label="Type of Income/Expense ie. Pay Check or Rent"
          variant="filled"
          fullWidth
          margin="normal"
        />
        <FormControl variant="filled" fullWidth>
          <InputLabel>Income or Expense</InputLabel>
          <Select
            value={type}
            // onChange={handleChange}
          >
            <MenuItem value={1}>Income</MenuItem>
            <MenuItem value={2}>Expense</MenuItem>
          </Select>
        </FormControl>
        <FormControl variant="filled" fullWidth>
          <InputLabel>Category</InputLabel>
          <Select
            value={[]}

            // onChange={handleChange}
          >
            <MenuItem value={1}>Mortgage/Rent</MenuItem>
            <MenuItem value={2}>Automotive</MenuItem>
            <MenuItem value={3}>Utilities</MenuItem>
            <MenuItem value={4}>Education</MenuItem>
            <MenuItem value={5}>Communication</MenuItem>
            <MenuItem value={6}>Health</MenuItem>
            <MenuItem value={7}>Insurance</MenuItem>
            <MenuItem value={8}>Food</MenuItem>
            <MenuItem value={9}>Entertainment</MenuItem>
            <MenuItem value={10}>Other</MenuItem>
            <MenuItem value={11}>Income</MenuItem>
          </Select>
        </FormControl>
        <FormControl fullWidth>
          <CurrencyTextField
            variant="filled"
            label="Amount"
            value={value}
            currencySymbol="$"
            maximumValue={"100000000000000000"}
            autoFocus
            onChange={(e, value) => setValue(value)}
            error={error}
            helperText={"minimum number is .01"}
            decimalCharacter="."
            digitGroupSeparator=","
          />
        </FormControl>
        <TextField
          id="filled-basic"
          label="Any thoughts you'd like to record about this entry?"
          variant="filled"
          fullWidth
          multiline
          margin="normal"
        />
      </div>
      <div>
        <Button variant="contained" color="primary">
          Add Another Entry
        </Button>
        <Button variant="contained" color="secondary">
          Done
        </Button>
      </div>
    </div>
  );
};
